CREATE DEFINER=`root`@`localhost` PROCEDURE `get_users_per_app`(id_list TEXT)
BEGIN
    SELECT
        stud_Id, GROUP_CONCAT(stud_Key)
    FROM
        tstudent
    WHERE
        FIND_IN_SET(stud_Key, id_list) > 0
    GROUP BY stud_Id;

END ;;
