				JOIN tHouseDesignation ON Hsn_HouseDesignationId = Hsd_Id
                JOIN tHouses ON Hsn_HouseId = Hus_Id
				JOIN tStudent on Hsn_studKey = stud_Key
				Join tClassSection on stud_ClassSectionId = Csc_Id
		where 
